<html lang="en" xmlns="http://www.w3.org/1999/xhtml"
	xmlns:h="http://java.sun.com/jsf/html"
	xmlns:f="http://java.sun.com/jsf/core"
	xmlns:p="http://primefaces.org/ui">
	
<h:head>
	<title>Home</title>
       
<!-- bootstrap 3.0.2 -->
        <h:outputStylesheet library="css" name="admin/css/bootstrap.min.css" />
         
        <!-- font Awesome -->
                <h:outputStylesheet library="css" name="admin/css/font-awesome.min.css" />
        
        <!-- Ionicons -->
                <h:outputStylesheet library="css" name="admin/css/ionicons.min.css" />
        
        <!-- Morris chart -->
                <h:outputStylesheet library="css" name="admin/css/morris/morris.css" />
        
        <!-- jvectormap -->
                <h:outputStylesheet library="css" name="admin/css/jvectormap/jquery-jvectormap-1.2.2.css" />
        
        <!-- fullCalendar -->
                <h:outputStylesheet library="css" name="admin/css/fullcalendar/fullcalendar.css" />
        
        <!-- Daterange picker -->
                <h:outputStylesheet library="css" name="admin/css/daterangepicker/daterangepicker-bs3.css" />
        
        <!-- bootstrap wysihtml5 - text editor -->
                <h:outputStylesheet library="css" name="admin/css/bootstrap-wysihtml5/bootstrap3-wysihtml5.min.css" />
        
        <!-- Theme style -->
                <h:outputStylesheet library="css" name="admin/css/AdminLTE.css" />
  
  
  
  
  
  
  
  
  
  
  
  <!-- jQuery 2.0.2 -->
        <script src="http://ajax.googleapis.com/ajax/libs/jquery/2.0.2/jquery.min.js"></script>
       
        <!-- jQuery UI 1.10.3 -->
        	<h:outputScript library="js" name="admin/js/jquery-ui-1.10.3.min.js" />
        
        <!-- Bootstrap -->
        	<h:outputScript library="js" name="admin/js/bootstrap.min.js" />
        
        <!-- Morris.js charts -->
        <script src="//cdnjs.cloudflare.com/ajax/libs/raphael/2.1.0/raphael-min.js"></script>
        
        	<h:outputScript library="js" name="admin/js/plugins/morris/morris.min.js" />
        
        <!-- Sparkline -->
        <script src="js/plugins/sparkline/jquery.sparkline.min.js" type="text/javascript"></script>
        
        <!-- jvectormap -->
        	<h:outputScript library="js" name="admin/js/plugins/jvectormap/jquery-jvectormap-1.2.2.min.js" />
        
        	<h:outputScript library="js" name="admin/js/plugins/jvectormap/jquery-jvectormap-world-mill-en.js" />
        
        <!-- fullCalendar -->
        	<h:outputScript library="js" name="admin/js/plugins/fullcalendar/fullcalendar.min.js" />
        
        <!-- jQuery Knob Chart -->
        	<h:outputScript library="js" name="admin/js/plugins/jqueryKnob/jquery.knob.js" />
        
        <!-- daterangepicker -->
        	<h:outputScript library="js" name="admin/js/plugins/daterangepicker/daterangepicker.js" />
        
        <!-- Bootstrap WYSIHTML5 -->
        	<h:outputScript library="js" name="admin/js/plugins/bootstrap-wysihtml5/bootstrap3-wysihtml5.all.min.js" />
        
        <!-- iCheck -->
        	<h:outputScript library="js" name="admin/js/plugins/iCheck/icheck.min.js" />
        

        <!-- AdminLTE App -->
        	<h:outputScript library="js" name="admin/js/AdminLTE/app.js" />
        
        
        <!-- AdminLTE dashboard demo (This is only for demo purposes) -->
        	<h:outputScript library="js" name="admin/js/AdminLTE/dashboard.js" />
     
 </h:head>
